window.bookSummaryJSON = "<p>Eighteen-year-old Tatiana is running from her past and her star-touched powers. Her power to heal may be overshadowed by more destructive abilities. Fleeing the persecution of those like her, Tatiana seeks refuge in a small town she once visited. But this civil haven, in a world where society has broken down, is beginning to crumble. Will Tatiana flee or stay and fight for the new life she has built? Only by harnessing the very forces that haunt her can Tatiana save her friends and herself.</p>"; 
